- input: "TEXT\x1CC00358952\x1CX0\x1C\x1CF3A\x1CTo Whom It May Concern, This amendment
    is in response to the letter dated 12/7/2010 in reference to the October Quarterly
    Report of the Steve Israel for Congress Committee (C00358952).     Specifically,
    this amendment will clarify a seemingly inadequate purpose on a disbursement on
    Schedule B, Line 17 to American Express made on 09-02-2010. The purpose of the
    disbursement as filed reads ?Reimbursement (see below if itemization is necessary)?
    but no memo items appear on the report following the disbursement.     After reviewing
    the report with the Reports Analysis Division and our filing software provider,
    we discovered that a lapse existed between the transaction date of a memo item
    and the date of payment for the disbursement to American Express.     Because
    of this gap, there were memo items that belonged to the disbursement in question
    that occurred outside the parameters of the reporting period, resulting in an
    exclusion from the report.     We have since found a method of disclosing all
    memo items for a given disbursement regardless of whether the date of the initial
    transaction lies outside of the parameters of the reporting period to ensure disclosure
    on the proper report.    We have instituted the new method of recording memo items
    to prevent this from happening in the future. Additionally, we will provide the
    Commission with an amended Post-General report (Pre-General report was not affected
    by these changes) to reflect the increased level of disclosure.    We remain committed
    to improving our standards of compliance and reporting and should the Commission
    have any further questions about this or any other matter, we welcome the opportunity
    to clarify our reports. We appreciate the Reports Analysis Division bringing this
    matter to our attention. \n"
